Parinayam [1994]

Director : T Hariharan

Writer : MT Vasudevan Nair

Starring : Manoj K Jayan, Vineeth, Mohini, Shanthi Krishna, Thilakan, Jagathy, Sukumari, Nedumudi Venu

Plot : Only three months after being married to an old man, a young Brahmin girl widowed at 17 had to live a life secluded from the world, even though her marriage has not been consummated...

